import React from 'react'
import './Portfolio.css'
import Menu from './Menu'

const Portfolio = () => {
  const [items,setItem] = Create.useState(Menu)
  return (
    <section className="work container section" id='work'>
      <h2 className='section__title'>Projects</h2>

      <div className="work__filters">
        <span className="work__item">Everything</span>
        <span className="work__item">WebApplication</span>
        <span className="work__item">MobileApplication</span>
      </div>

      <div className='work__container grid'>
        {items.map((item)=>{
          return (
            <div className="work__card" key={item.id}>
              <img src={item.image} alt="" className="work__img" />
              <h3 className="work__title">{item.title}</h3>
              <a href={item.link} className="work__button">
                <i className="icon-link work__icon"></i>
              </a>
            </div>
          )
        })}
      </div>
    </section>
  )
}

export default Portfolio
